import LevelBuilderfrom sprites import *def render(name,bg):	lb = LevelBuilder.LevelBuilder(name+".plist",background=bg)	lb.addObject(Enemy.EnemySprite(x=373, y=127,width=84,height=84,angle='0',restitution=0.2,static='false',friction=0.5,density=1 ).setName('Body'))	lb.addObject(Enemy.EnemySprite(x=373, y=190,width=32,height=32,angle='0',restitution=0.2,static='false',friction=0.5,density=2 ).setName('Head'))	lb.addObject(Enemy.EnemySprite(x=404, y=62,width=24,height=24,angle='0',restitution=0.2,static='false',friction=0.5,density=2 ).setName('rightKnee'))	lb.addObject(Enemy.EnemySprite(x=343, y=62,width=24,height=24,angle='0',restitution=0.2,static='false',friction=0.5,density=2 ).setName('leftKnee'))	lb.addObject(Enemy.EnemySprite(x=340, y=24,width=48,height=48,angle='0',restitution=0.2,static='false',friction=0.5,density=25 ).setName('leftFoot'))	lb.addObject(Enemy.EnemySprite(x=406, y=24,width=48,height=48,angle='0',restitution=0.2,static='false',friction=0.5,density=25 ).setName('rightFoot'))	lb.addObject(Enemy.EnemySprite(x=373, y=170,width=2,height=2,angle='0',restitution=0.2,static='false',friction=0.5,density=20 ).setName('bodyOrbiter'))	lb.addObject(Enemy.EnemySprite(x=373, y=207,width=2,height=2,angle='0',restitution=0.2,static='false',friction=0.5,density=20 ).setName('headOrbiter'))	lb.addObject(Joints.RevoluteJoint(body1='Head',body2='headOrbiter',motor_speed='5000',enable_motor='true',torque='10000',lower_angle='12',upper_angle='50',enable_limit='false',collide_connected='false'))	lb.addObject(Enemy.EnemySprite(x=404, y=76,width=2,height=2,angle='0',restitution=0.2,static='false',friction=0.5,density=20 ).setName('rightKneeOrbiter'))	lb.addObject(Joints.RevoluteJoint(body1='rightKnee',body2='rightKneeOrbiter',motor_speed='5000',enable_motor='true',torque='10000',lower_angle='12',upper_angle='50',enable_limit='false',collide_connected='false'))	lb.addObject(Enemy.EnemySprite(x=343, y=76,width=2,height=2,angle='0',restitution=0.2,static='false',friction=0.5,density=20 ).setName('leftKneeOrbiter'))	lb.addObject(Joints.RevoluteJoint(body1='leftKnee',body2='leftKneeOrbiter',motor_speed='5000',enable_motor='true',torque='10000',lower_angle='12',upper_angle='50',enable_limit='false',collide_connected='false'))	lb.addObject(Joints.DistanceJoint(body1='Head',body2='Body',damping='0.2',freq='2' ))	lb.addObject(Joints.DistanceJoint(body1='leftKnee',body2='Body',damping='0.2',freq='2' ))	lb.addObject(Joints.DistanceJoint(body1='rightKnee',body2='Body',damping='0.2',freq='2' ))	lb.addObject(Joints.DistanceJoint(body1='leftKnee',body2='leftFoot',damping='0.2',freq='4' ))	lb.addObject(Joints.DistanceJoint(body1='rightKnee',body2='rightFoot',damping='0.2',freq='4' ))	lb.addObject(Hero.HeroSprite(x=45, y=18,width=32,height=32))	lb.addObject(Joints.RevoluteJoint(body1='Body',body2='bodyOrbiter',motor_speed='5000',enable_motor='true',torque='10000',lower_angle='12',upper_angle='50',enable_limit='false',collide_connected='false'))	lb.addObject(Star.StarSprite(x=436, y=125,width=32,height=32))	lb.addObject(Contacts.Contact(body1='leftFoot',body2='Hero',event_name='onLose'))	lb.addObject(Contacts.Contact(body1='rightFoot',body2='Hero',event_name='onLose'))	lb.addObject(Contacts.Contact(body1='rightKnee',body2='Hero',event_name='onLose'))	lb.addObject(Contacts.Contact(body1='leftKnee',body2='Hero',event_name='onLose'))	lb.addObject(Contacts.Contact(body1='Body',body2='Hero',event_name='onLose'))	lb.addObject(Contacts.Contact(body1='Head',body2='Hero',event_name='onLose'))	lb.addObject(Joints.DistanceJoint(body1='Star',body2='Body',damping='0.2',freq='2' ))	lb.render()